import React from 'react'
import Nav from './components/Nav'
import axios from 'axios'

class Profile extends Component {
  state = {
    users: [],
  }

  ComponentDidMount() {
    axios.get('/api/users').then((res) => {
      const users = res.data
      this.setState({ users })
    })
  }

  render() {
    return (
      <>
        <Nav />
      </>
    )
  }
}

export default Profile
